import React from "react";

const UserCard = ({ nombre, apellido, type }) => {
  return (
    <div
      className={` text-xl m-5 text-white ${
        type === "connected" ? "  bg-green" : " bg-red"
      } `}
    >
      <h2>
        {nombre} {apellido}
      </h2>
    </div>
  );
};

export default UserCard;
